import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // 1. Click on a product card to open the modal
    const productCardSelector = '.product-card';
    await page.waitForSelector(productCardSelector, { timeout: 5000 });
    await page.locator(productCardSelector).first().click();

    // 2. Wait for the modal to be visible and take a screenshot
    const modalSelector = '#productModal';
    await page.waitForSelector(modalSelector, { state: 'visible', timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_modal_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_modal_open.png'));

    // 3. Extract the display style of the open modal
    const modalDisplayStyleBefore = await page.locator(modalSelector).evaluate(el => getComputedStyle(el).display);

    // 4. Press the Escape key to close the modal
    await page.keyboard.press('Escape');

    // 5. Wait for the modal to be hidden
    await page.waitForSelector(modalSelector, { state: 'hidden', timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_modal_closed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_modal_closed.png'));

    // 6. Extract the display style of the closed modal
    const modalDisplayStyleAfter = await page.locator(modalSelector).evaluate(el => getComputedStyle(el).display);

    return {
      success: true,
      action: "Closed a product detail modal using the Escape key.",
      extractedData: {
        modalDisplayStyleBefore,
        modalDisplayStyleAfter
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to close modal with Escape key.",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
